import log from '../util/log'

function warn({ version, from, to }) {
  log.warn(`${from}-color-renamed`, [
    `As of Tailwind CSS ${version}, \`${from}\` has been renamed to \`${to}\`.`,
    'Update your configuration file to silence this warning.',
  ])
}

